openapi: 3.0.0
info:
  title: ESV
  version: '1'
  description: Volunteer MVP API
  contact:
    name: gaia
    email: gaia@gaiaresources.com.au
servers:
  - description: MVP
    url: 'https://virtserver.swaggerhub.com/JasonGaia/ESV/1'
paths:
  /api/v1/logout:
    get:
      summary: ''
      operationId: get-users-logout
      responses:
        '200':
          description: OK
          headers: {}
        '426':
          description: Upgrade Required
      parameters:
        - schema:
            type: string
          in: header
          name: Authorization
          description: Auth Token
      tags:
        - user
      description: User logout (token based)
    parameters: []
  /api/v1/profile:
    get:
      summary: ''
      tags:
        - user
      responses:
        '200':
          description: OK
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/Profile'
              examples:
                Standard:
                  value:
                    first_name: John
                    last_name: Smith
                    email: simon.wicha@gaiaresources.com.au
                    volunteer_id: '12345'
                    dob: 23/12/1984
                    avatar_image: 
                Avatar NULL:
                  value:
                    first_name: John
                    last_name: Smith
                    email: simon.wicha@gaiaresources.com.au
                    volunteer_id: '12345'
                    dob: 23/12/1984
                    avatar_image: null
                Avatar Image (invalid):
                  value:
                    first_name: John
                    last_name: Smith
                    email: simon.wicha@gaiaresources.com.au
                    volunteer_id: '12345'
                    dob: 23/12/1984
                    avatar_image: 'data:image/jpeg;base64,'
                Avatar Image:
                  value:
                    first_name: John
                    last_name: Smith
                    email: simon.wicha@gaiaresources.com.au
                    volunteer_id: '12345'
                    dob: 23/12/1984
                    avatar_image: 
